var height=3 *inch;


var top =shape({
		path:[
			"m", 0, 0,
			"l", -inch, 0,
			"q", -2*inch, 0, -2*inch, inch,
			"l", -2*inch, 2*inch,
			"q", -2*inch, 3*inch, -1*inch, 3*inch,
			"l", 0, 3*inch,
			"l", 0,0
		],
		fn:100});




var plate= {
		path:[
			"m",0,0,0,
			"l", 0,0,inch
		],
		fn:100
	};
return linePaths3d(top, plate);

